import "./App.css";
import React from "react";
import TemporaryDrawer from "./Components/TemporaryDrawer";
import Home from "./Pages/Home";
import Background from "./Pages/Background";

function App() {
  return (
    <div className="App">
      <TemporaryDrawer />
      <Home />
      <Background />
    </div>
  );
}

export default App;
